orld Cup Series Medal Table for Speed\" src=\"ref://19c9b08496\" caption=\"results including Wujiang 2024 event\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Cup Series Medal Table all Disciplines\" src=\"ref://c835301ae8\" caption=\"results including Wujiang 2024 event\"/\u003e\u003cGroup label=\"World Cup Series Boulder podium list (male and female)\" columns=\"1\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://3b9bbd37a4\" caption=\"Boulder\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Cup Series Lead podium list (male and female)\" columns=\"1\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://e076ba201f\" caption=\"Lead\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Cup Series Speed podium list (male and female)\" columns=\"1\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://3a3258cacc\" caption=\"Speed\"/\u003e\u003c/Group\u003e\u003c/Select\u003e\u003c/Group\u003e\u003cGroup label=\"Special Analysis World Cups\" columns=\"1\" valign=\"top\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Male Speed Qualifying times by Year\" responsive=\"true\" scale=\"1.0\" src=\"ref://862e7ae2cb\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Female Speed Qualifying times by Year\" responsive=\"true\" scale=\"1.0\" src=\"ref://d2f0f137d1\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Lead Tops in Finals by Year\" responsive=\"true\" scale=\"1.0\" src=\"ref://1f05bf63f1\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Lead Tops in Semi-Finals by Year\" responsive=\"true\" scale=\"1.0\" src=\"ref://12cbb48682\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Lead Tops in Finals \u0026amp; Semi-Finals by Year\" responsive=\"true\" scale=\"1.0\" src=\"ref://f809375d46\"/\u003e\u003cText label=\"Analysis\"\u003e\u003c![CDATA[### This explains the Speed box plots  \nThe horizontal lines bottom and top are the min and max values  \nThe line across the waist of the box is the median value  \nThe bottom and top of the box are the 1st and 3rd quartile values  \nThe dots at the top are statistical outliers  \n\n  Hover on a box and it will show all the values  \n\n### Speed Analysis  \nparticuluarly in the Mens results you can see the height of the box has shrunk meaning the times of the majority and getting closer  \n2021 only had 2 events so doesn\u0027t have as much variation as normal years with more events.  \nThe times before 2012 were so slow you couldn\u0027t see the detail in the later years  \nThis is qualifying times only, the finals times are harder to collate as the format on the IFSC website has changed over the years  \n\n### Lead Analysis  \nThis show that generally there are more tops in female lead comps than there are in mens, this indicates the women are not being challenged as much as the men.  \nIn Finals in 12 of the last 16 years there have been more female tops, only 2 years where there were more tops, and 2 years where they were the same.]]\u003e\u003c/Text\u003e\u003c/Select\u003e\u003c/Group\u003e\u003c/Select\u003e\u003c/View\u003e", "assets": {"f515244154": {"src": "data:application/vnd.datapane.table+html;base64,PHN0eWxlIHR5cGU9InRleHQvY3NzIj4KI1RfMmUzNmVfICB7CiAgYm9yZGVyOiAycHggc29saWQgYmxhY2s7Cn0KI1RfMmUzNmVfcm93MF9jb2wxIHsKICB3aWR0aDogMTBlbTsKICBoZWlnaHQ6IDgwJTsKICBiYWNrZ3JvdW5kOiBsaW5lYXItZ3JhZGllbnQoOTBkZWcsbGlnaHRibHVlIDEwMC4wJSwgdHJhbnNwYXJlbnQgMTAwLjAlKTsKfQojVF8yZTM2ZV9yb3cxX2NvbDEgewogIHdpZHRoOiAxMGVtOwogIGhlaWdodDogODAlOwogIGJhY2tncm91bmQ6IGxpbmVhci1ncmFkaWVudCg5MGRlZyxsaWdodGJsdWUgNzguOSUsIHRyYW5zcGFyZW50IDc4LjklKTsKfQojVF8yZTM2ZV9yb3cyX2NvbDEsICNUXzJlMzZlX3JvdzNfY29sMSB7CiAgd2lkdGg6IDEwZW07CiAgaGVpZ2h0OiA4MCU7CiAgYmFja2dyb3VuZDogbGluZWFyLWdyYWRpZW50KDkwZGVnLGxpZ2h0Ymx1ZSAzNi44JSwgdHJhbnNwYXJlbnQgMzYuOCUpOwp9CiNUXzJlMzZ
